import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {

  const [hello,setHello] = useState('default')

  useEffect(() => {
    fetch("/api/hello")
        .then((res) => {return res.json();})
        .then((data) => {setHello(data);})
  }, []);



  return (
    <div className="App">
      <h1>서버에서 가져온 itx 출발 시간표</h1>
      {hello}
    </div>
  );
}

export default App;
